    &lt;h1 class="heading&amp;#160;1" style="margin-left: 0.0mm; text-indent: 0.0mm;"&gt;Sammanfattning&lt;/h1&gt;
    &lt;p class="Normal"&gt;Kommissionens presenterade i november 2006 sitt regelf&amp;ouml;rb&amp;auml;ttringspaket. Det best&amp;aring;r av tre delar. Det f&amp;ouml;rsta &amp;auml;r en strategisk &amp;ouml;versyn av vad kommissionen anser beh&amp;ouml;ver g&amp;ouml;ras och de framsteg som hittills uppn&amp;aring;tts. Det andra &amp;auml;r en strategi f&amp;ouml;r f&amp;ouml;renkling som i huvudsak &amp;auml;r en uppdatering av det rullande f&amp;ouml;renklingsprogram som presenterades i oktober 2005. Det tredje &amp;auml;r kommissionens prelimin&amp;auml;ra tankar avseende hur man b&amp;ouml;r g&amp;aring; till v&amp;auml;ga p&amp;aring; EU-niv&amp;aring; n&amp;auml;r administrativa b&amp;ouml;rdor f&amp;ouml;r f&amp;ouml;retagen ska m&amp;auml;tas. Det sistn&amp;auml;mnda &amp;auml;r ocks&amp;aring; f&amp;ouml;rem&amp;aring;l f&amp;ouml;r samr&amp;aring;d med allm&amp;auml;nheten. Bland annat s&amp;aring; f&amp;ouml;resl&amp;aring;r kommissionen att man b&amp;ouml;r anta ett m&amp;aring;l f&amp;ouml;r minskning av b&amp;ouml;rdorna p&amp;aring; 25 procent att uppn&amp;aring;s senast 2012. M&amp;aring;let ska uppn&amp;aring;s p&amp;aring; EU-niv&amp;aring;n och p&amp;aring; medlemsstatsniv&amp;aring; gemensamt. Kommissionen vill att Europeiska r&amp;aring;det p&amp;aring; sitt m&amp;ouml;te i mars 2007 ska bl.a. fastst&amp;auml;lla ett &amp;ouml;vergripande m&amp;aring;l f&amp;ouml;r att minska de administrativa b&amp;ouml;rdorna i EU. &lt;/p&gt;
    &lt;p class="Normal"&gt;Kommissionen kommer att, i slutet av januari 2007, presentera en handlingsplan f&amp;ouml;r hur den n&amp;auml;rmare ska g&amp;aring; till v&amp;auml;ga f&amp;ouml;r att g&amp;ouml;ra m&amp;auml;tningar av administrativa b&amp;ouml;rdor till f&amp;ouml;ljd av EU:s lagstiftning.&lt;/p&gt;
    &lt;p class="Normal"&gt;Regeringen st&amp;ouml;der kommissionens regelf&amp;ouml;rb&amp;auml;ttringspaket och de f&amp;ouml;rslag som finns med. Att EU:s r&amp;auml;ttsakter ses &amp;ouml;ver, moderniseras och f&amp;ouml;renklas &amp;auml;r n&amp;ouml;dv&amp;auml;ndigt f&amp;ouml;r att st&amp;auml;rka f&amp;ouml;retagens konkurrenskraft. M&amp;auml;tningarna som kommissionen planerar &amp;auml;r viktiga f&amp;ouml;r att b&amp;auml;ttre identifiera var det finns st&amp;ouml;rst potential f&amp;ouml;r framtida f&amp;ouml;renklingsinsatser. Regeringen ger vidare sitt st&amp;ouml;d &amp;aring;t att ett m&amp;aring;l om 25 procents minskning senast 2012 antas av Europeiska r&amp;aring;det vid v&amp;aring;rtoppm&amp;ouml;tet i mars 2007. M&amp;aring;let b&amp;ouml;r g&amp;auml;lla EU:s lagstiftning.&lt;/p&gt;
    &lt;h1 class="heading&amp;#160;1"&gt;&lt;span class="upcast-HEADINGNUMBER"&gt;1&amp;#9;&lt;/span&gt;F&amp;ouml;rslaget&lt;/h1&gt;
    &lt;h2 class="heading&amp;#160;2"&gt;&lt;span class="upcast-HEADINGNUMBER"&gt;1.1&amp;#9;&lt;/span&gt;Inneh&amp;aring;ll&lt;/h2&gt;
    &lt;p class="Normal"&gt;Kommissionens presenterade i november 2006 sitt regelf&amp;ouml;rb&amp;auml;ttringspaket. Det best&amp;aring;r av tre delar. Det f&amp;ouml;rsta [KOM (2006) 689] &amp;auml;r en strategisk &amp;ouml;versyn av vad kommissionen anser beh&amp;ouml;ver g&amp;ouml;ras och de framsteg som hittills uppn&amp;aring;tts. Det andra [KOM (2006) 690] &amp;auml;r en strategi f&amp;ouml;r f&amp;ouml;renkling som i huvudsak &amp;auml;r en uppdatering av det rullande f&amp;ouml;renklingsprogram som presenterades i oktober 2005 [KOM (2005) 535 slutlig]. Det tredje [KOM (2006) 691] &amp;auml;r kommissionens prelimin&amp;auml;ra tankar avseende hur man b&amp;ouml;r g&amp;aring; till v&amp;auml;ga p&amp;aring; EU-niv&amp;aring; n&amp;auml;r administrativa b&amp;ouml;rdor f&amp;ouml;r f&amp;ouml;retagen ska m&amp;auml;tas.&lt;/p&gt;
    &lt;p class="Normal"&gt;Den f&amp;ouml;rsta delen i paketet - Kommissionens strategiska &amp;ouml;versyn av programmet ”B&amp;auml;ttre lagstiftning” inom Europeiska unionen - inneh&amp;aring;ller i huvudsak en l&amp;auml;gesrapport av p&amp;aring;g&amp;aring;ende och kommande initiativ med tyngdpunkt p&amp;aring; de tv&amp;aring; andra meddelandena i paketet (se nedan). Ut&amp;ouml;ver detta framh&amp;aring;ller kommissionen att den ska st&amp;auml;rka granskningen av konsekvensbed&amp;ouml;mningarna genom att inr&amp;auml;tta en oberoende konsekvensbed&amp;ouml;mningsn&amp;auml;mnd och sk&amp;auml;rpa genomf&amp;ouml;randet av gemenskapsr&amp;auml;tten. &lt;/p&gt;
    &lt;p class="Normal"&gt;R&amp;aring;det och Europaparlamentet b&amp;ouml;r, enligt kommissionen, prioritera systematiska konsekvensbed&amp;ouml;mningar av viktiga &amp;auml;ndringar av kommissionsf&amp;ouml;rslag och b&amp;ouml;r ge h&amp;ouml;g prioritet &amp;aring;t presenterade f&amp;ouml;renklingsf&amp;ouml;rslag, kodifiering och upph&amp;auml;vande av f&amp;ouml;r&amp;aring;ldrade r&amp;auml;ttsakter. Medlemsstaterna b&amp;ouml;r bl.a. utforma och genomf&amp;ouml;ra samr&amp;aring;dsmekanismer, g&amp;ouml;ra mer systematiska bed&amp;ouml;mningar av ekonomiska, sociala och milj&amp;ouml;m&amp;auml;ssiga effekter och utarbeta f&amp;ouml;renklingsprogram. &lt;/p&gt;
    &lt;p class="Normal"&gt;F&amp;ouml;r EU och medlemsstaterna f&amp;ouml;resl&amp;aring;r kommissionen att man vid Europeiska r&amp;aring;dets m&amp;ouml;te v&amp;aring;ren 2007 fastst&amp;auml;ller ett gemensamt m&amp;aring;l f&amp;ouml;r minskning av de administrativa kostnaderna med 25 procent fram till 2012.&lt;/p&gt;
    &lt;p class="Normal"&gt;Den andra delen i paketet &amp;auml;r den f&amp;ouml;rsta l&amp;auml;gesrapporten om strategin f&amp;ouml;r f&amp;ouml;renkling av lagstiftningen. I rapporten beskriver kommissionen hur arbetet f&amp;ouml;rflutit sedan den f&amp;ouml;rsta strategin presenterades i oktober 2005 och vad som h&amp;auml;nt med de olika f&amp;ouml;renklingsf&amp;ouml;rslagen, hur m&amp;aring;nga som f&amp;ouml;rsenats och vilka l&amp;auml;rdomar man dragit. I rapporten presenteras b&amp;aring;de de gamla och de tillkommande r&amp;auml;ttsakterna som ska bli f&amp;ouml;rem&amp;aring;l f&amp;ouml;r regelf&amp;ouml;renkling och den tidtabell som g&amp;auml;ller f&amp;ouml;r deras respektive presentation. Till de tidigare 220 r&amp;auml;ttsakterna har ytterligare 43 initiativ lagts och sammantaget kommer allts&amp;aring; dessa att vara f&amp;ouml;rem&amp;aring;l f&amp;ouml;r &amp;aring;tg&amp;auml;rder under &amp;aring;ren 2006-2009. Alla kommer inte att beh&amp;ouml;va beslutas av r&amp;aring;det eller Europaparlamentet utan vissa r&amp;auml;ttsakter f&amp;ouml;rfogar kommissionen sj&amp;auml;lv &amp;ouml;ver. &lt;/p&gt;
    &lt;p class="Normal"&gt;I den tredje delen av paketet - ”Ber&amp;auml;kning av administrativa kostnader och minskning av de administrativa b&amp;ouml;rdorna i Europeiska unionen” - som ocks&amp;aring; kommissionen l&amp;aring;tit g&amp;ouml;ra tillg&amp;auml;nglig f&amp;ouml;r samr&amp;aring;d, beskrivs hur kommissionen avser att m&amp;auml;ta de administrativa kostnaderna som EU:s regler medf&amp;ouml;r f&amp;ouml;r f&amp;ouml;retagen. Kommissionen f&amp;ouml;resl&amp;aring;r att vissa pilotomr&amp;aring;den m&amp;auml;ts i ett f&amp;ouml;rsta steg. N&amp;auml;r m&amp;auml;tningarna &amp;auml;r genomf&amp;ouml;rda finns ytterligare underlag f&amp;ouml;r att identifiera l&amp;auml;tta &amp;auml;ndringar i lagstiftningen. Kommissionen har muntligen f&amp;ouml;rtydligat att avsikten &amp;auml;r att ta bort on&amp;ouml;diga administrativa b&amp;ouml;rdor. Metoden man avser att anv&amp;auml;nda bygger p&amp;aring; den s.k. standardkostnadsmodellen som &amp;auml;ven anv&amp;auml;nds i Sverige vid m&amp;auml;tningar av f&amp;ouml;retagens administrativa b&amp;ouml;rdor. &lt;/p&gt;
    &lt;p class="Normal"&gt;Regeringen, genom n&amp;auml;ringsminister Maud Olofsson, har i brev till kommissionen (N2006/11294/NL) givit sitt st&amp;ouml;d &amp;aring;t paketet som helhet och &amp;auml;ven givit f&amp;ouml;rslag p&amp;aring; exempel p&amp;aring; milj&amp;ouml;lagstiftning som skulle kunna ing&amp;aring; i de planerade m&amp;auml;tningarna.&lt;/p&gt;
    &lt;h2 class="heading&amp;#160;2"&gt;&lt;span class="upcast-HEADINGNUMBER"&gt;1.2&amp;#9;&lt;/span&gt;G&amp;auml;llande svenska regler och f&amp;ouml;rslagets effekt p&amp;aring; dessa&lt;/h2&gt;
    &lt;p class="Normal"&gt;Inga omedelbara effekter p.g.a.  meddelandena. &lt;/p&gt;
    &lt;p class="Normal"&gt;Givetvis kommer f&amp;ouml;renklingsf&amp;ouml;rslagen [KOM (2006) 690] n&amp;auml;r de presenterats att i f&amp;ouml;rekommande fall kr&amp;auml;va &amp;auml;ndringar i de svenska regler genom vilka de ursprungliga r&amp;auml;ttsakterna genomf&amp;ouml;rts. Hur dessa &amp;auml;ndringar kommer att se ut kan inte bed&amp;ouml;mas i dagsl&amp;auml;get utan detta kommer att visa sig allteftersom f&amp;ouml;rslagen presenteras av kommissionen.&lt;/p&gt;
    &lt;h2 class="heading&amp;#160;2"&gt;&lt;span class="upcast-HEADINGNUMBER"&gt;1.3&amp;#9;&lt;/span&gt;Budget&amp;auml;ra konsekvenser&lt;/h2&gt;
    &lt;p class="Normal"&gt;Inga.&lt;/p&gt;
    &lt;p class="Normal"&gt;Regler som kr&amp;auml;ver f&amp;auml;rre administrativa resurser f&amp;ouml;r myndigheterna f&amp;ouml;r uppf&amp;ouml;ljning kan f&amp;ouml;rst&amp;aring;s medf&amp;ouml;ra besparingar &amp;auml;ven f&amp;ouml;r dem och inte bara f&amp;ouml;r f&amp;ouml;retag och medborgare.&lt;/p&gt;
    &lt;h1 class="heading&amp;#160;1"&gt;&lt;span class="upcast-HEADINGNUMBER"&gt;2&amp;#9;&lt;/span&gt;St&amp;aring;ndpunkter&lt;/h1&gt;
    &lt;h2 class="heading&amp;#160;2"&gt;&lt;span class="upcast-HEADINGNUMBER"&gt;2.1&amp;#9;&lt;/span&gt;Svensk st&amp;aring;ndpunkt&lt;/h2&gt;
    &lt;p class="Normal"&gt;Regeringen st&amp;ouml;der kommissionens regelf&amp;ouml;rb&amp;auml;ttringspaket och de f&amp;ouml;rslag som presenterats. De olika initiativen och verktygen f&amp;ouml;r b&amp;auml;ttre, enklare och mer &amp;auml;ndam&amp;aring;lsenliga regler kompletterar och f&amp;ouml;rst&amp;auml;rker varandra. Att EU:s r&amp;auml;ttsakter ses &amp;ouml;ver, moderniseras och f&amp;ouml;renklas &amp;auml;r n&amp;ouml;dv&amp;auml;ndigt f&amp;ouml;r att st&amp;auml;rka f&amp;ouml;retagens konkurrenskraft. M&amp;auml;tningarna som kommissionen planerar &amp;auml;r viktiga f&amp;ouml;r att identifiera var det finns st&amp;ouml;rst potential f&amp;ouml;r framtida f&amp;ouml;renklingsinsatser. F&amp;ouml;renklingsf&amp;ouml;rslagen som kommissionen kommer att presentera f&amp;aring;r sj&amp;auml;lvklart bed&amp;ouml;mas i varje enskilt fall men arbetss&amp;auml;ttet med att s&amp;auml;tta upp ett rullande program med r&amp;auml;ttsakter f&amp;ouml;r f&amp;ouml;renklingsinsatser &amp;auml;r r&amp;auml;tt arbetsmetod.&lt;/p&gt;
    &lt;p class="Normal"&gt;Regeringen st&amp;ouml;der ocks&amp;aring; att ett m&amp;aring;l p&amp;aring; EU-niv&amp;aring; f&amp;ouml;r minskning av administrativa b&amp;ouml;rdor med 25 procent senast 2012 antas av Europeiska r&amp;aring;det vid v&amp;aring;rtoppm&amp;ouml;tet 2007. M&amp;aring;let b&amp;ouml;r g&amp;auml;lla EU:s lagstiftning. Ett m&amp;aring;l &amp;auml;r n&amp;ouml;dv&amp;auml;ndigt f&amp;ouml;r att n&amp;aring; resultat. I ett senare skede kommer det att beh&amp;ouml;va klarg&amp;ouml;ras vem som ska g&amp;ouml;ra vad f&amp;ouml;r att m&amp;aring;let ska n&amp;aring;s. &lt;/p&gt;
    &lt;p class="Normal"&gt;Sverige anser ocks&amp;aring; att arbetet med att f&amp;ouml;rb&amp;auml;ttra spr&amp;aring;klig och redaktionell kvalitet i EU:s lagstiftning &amp;auml;r viktigt f&amp;ouml;r att skapa mer anv&amp;auml;ndarv&amp;auml;nlig och l&amp;auml;ttf&amp;ouml;rst&amp;aring;elig lagstiftning. &lt;/p&gt;
    &lt;h2 class="heading&amp;#160;2"&gt;&lt;span class="upcast-HEADINGNUMBER"&gt;2.2&amp;#9;&lt;/span&gt;Medlemsstaternas st&amp;aring;ndpunkter&lt;/h2&gt;
    &lt;p class="Normal"&gt;Vid r&amp;aring;dsm&amp;ouml;tet (konkurrenskraft) den 4 december 2006 v&amp;auml;lkomnade alla medlemsstater kommissionens initiativ i stort.&lt;/p&gt;
    &lt;p class="Normal"&gt;Det som det r&amp;aring;der delade meningar om g&amp;auml;ller fr&amp;aring;gan om ett m&amp;aring;l f&amp;ouml;r minskning av f&amp;ouml;retagens administrativa b&amp;ouml;rdor. L&amp;auml;nder som Storbritannien, Nederl&amp;auml;nderna, Danmark, Tjeckien och Sverige st&amp;ouml;der m&amp;aring;let men f&amp;ouml;rtydligar att detta b&amp;ouml;r enbart g&amp;auml;lla EU:s lagstiftning. Ett m&amp;aring;l bed&amp;ouml;ms som viktigt eftersom m&amp;aring;l &amp;auml;r styrande f&amp;ouml;r arbetet och n&amp;ouml;dv&amp;auml;ndigt f&amp;ouml;r uppf&amp;ouml;ljning. Det &amp;auml;r vidare viktigt med ett m&amp;aring;l f&amp;ouml;r EU:s lagstiftning som ett komplement till redan satta nationella m&amp;aring;l p&amp;aring; samma omr&amp;aring;de. Den svenska regeringen har som m&amp;aring;l att minska f&amp;ouml;retagens administrativa b&amp;ouml;rdor med minst 25 procent till 2010.&lt;/p&gt;
    &lt;p class="Normal"&gt;Andra l&amp;auml;nder, som t.ex. Frankrike, Irland och Luxemburg, &amp;auml;r mer tveksamma. Bland annat s&amp;aring; anser dessa l&amp;auml;nder att det inte ankommer p&amp;aring; EU-niv&amp;aring; att best&amp;auml;mma m&amp;aring;l f&amp;ouml;r det som &amp;auml;r nationella angel&amp;auml;genheter. Dessa l&amp;auml;nder mots&amp;auml;tter sig dock inte att de administrativa b&amp;ouml;rdorna till f&amp;ouml;ljd av lagstiftningen minskar i sig.&lt;/p&gt;
    &lt;h2 class="heading&amp;#160;2"&gt;&lt;span class="upcast-HEADINGNUMBER"&gt;2.3&amp;#9;&lt;/span&gt;Institutionernas st&amp;aring;ndpunkter&lt;/h2&gt;
    &lt;p class="Normal"&gt;Europaparlamentets st&amp;aring;ndpunkt &amp;auml;r inte k&amp;auml;nd.&lt;/p&gt;
    &lt;h2 class="heading&amp;#160;2"&gt;&lt;span class="upcast-HEADINGNUMBER"&gt;2.4&amp;#9;&lt;/span&gt;Remissinstansernas st&amp;aring;ndpunkter&lt;/h2&gt;
    &lt;p class="Normal"&gt;N&amp;auml;ringslivet i Sverige genom N&amp;auml;ringslivets regeln&amp;auml;mnd har uttalat sig positivt. &lt;/p&gt;
    &lt;h1 class="heading&amp;#160;1"&gt;&lt;span class="upcast-HEADINGNUMBER"&gt;3&amp;#9;&lt;/span&gt;&amp;Ouml;vrigt&lt;/h1&gt;
    &lt;h2 class="heading&amp;#160;2"&gt;&lt;span class="upcast-HEADINGNUMBER"&gt;3.1&amp;#9;&lt;/span&gt;Fortsatt behandling av &amp;auml;rendet&lt;/h2&gt;
    &lt;p class="Normal"&gt;Det tyska ordf&amp;ouml;randeskapet planerar att ett m&amp;aring;l f&amp;ouml;r minskning av de administrativa kostnaderna ska s&amp;auml;ttas vid Europeiska r&amp;aring;dets m&amp;ouml;te v&amp;aring;ren 2007. Paketet kommer att behandlas i r&amp;aring;det. B&amp;aring;de konkurrenskraftsr&amp;aring;det och r&amp;aring;det f&amp;ouml;r ekonomiska och finansiella fr&amp;aring;gor (Ekofin) kommer att hantera paketet.&lt;/p&gt;
    &lt;h2 class="heading&amp;#160;2"&gt;&lt;span class="upcast-HEADINGNUMBER"&gt;3.2&amp;#9;&lt;/span&gt;R&amp;auml;ttslig grund och beslutsf&amp;ouml;rfarande&lt;/h2&gt;
    &lt;p class="Normal"&gt;-&lt;/p&gt;
    &lt;h2 class="heading&amp;#160;2"&gt;&lt;span class="upcast-HEADINGNUMBER"&gt;3.3&amp;#9;&lt;/span&gt;Fackuttryck/termer&lt;/h2&gt;
    &lt;p class="Normal"&gt;I Sverige anv&amp;auml;nds standardkostnadsmodellen f&amp;ouml;r att m&amp;auml;ta f&amp;ouml;retagens administrativa kostnader. Modellen har utvecklats i Holland och har anv&amp;auml;nts d&amp;auml;r sedan 1994. Standardkostnadsmodellen &amp;auml;r inte n&amp;aring;gon statistisk metod. Den bygger p&amp;aring; v&amp;auml;rderingar av hur mycket tid ett normaleffektivt f&amp;ouml;retag avs&amp;auml;tter f&amp;ouml;r att hantera de krav som finns i lagstiftningen p&amp;aring; de s&amp;auml;tt som de &amp;auml;r avsedda att f&amp;ouml;ljas. M&amp;aring;let &amp;auml;r inte att f&amp;aring; fram en exakt siffra som utvisar de administrativa kostnaderna. M&amp;auml;tningarna ska ist&amp;auml;llet ses som ett verktyg i myndigheternas och departementens regelf&amp;ouml;rb&amp;auml;ttringsarbete, t ex genom att ge detaljkunskap om hur kostnaderna ser ut och g&amp;ouml;ra det m&amp;ouml;jligt att f&amp;ouml;lja kostnadernas utveckling &amp;ouml;ver tiden.&lt;/p&gt;
</html>
